import React from "react";
import { Route } from "react-router-dom";



import ApplicantList from "./containers/job_application/applicant/ApplicantListView";
import ApplicantDetail from "./containers/job_application/applicant/ApplicantDetailView";

import RegistrationForm from "./containers/templates/register";



const BaseRouter = () => (
  <div>

    <Route exact path="/" component={ApplicantList} />{" "} 
    <Route exact path="/:applicantID" component={ApplicantDetail} />{" "} 

    <Route exact path="/register" component={RegistrationForm} />{" "} 

  </div>
);

export default BaseRouter;
